description:
100 Percent Hidden Objects: Hidden Object fanatics, we've got just the game for you! Forget those long-winded stories and dive right into the hidden object scenes you love! Let your eyes feast on an abundance of HO scenes, with beautiful graphics and multiple game modes that let you control your gaming experience. Are you most enthused by search lists and classic gameplay? Would you rather play detective and match an object to its silhouette? Now you can do both and have it all in one fantastic game! Skip the fluff and get right to the search in 100% Hidden Objects!
